This is a balancing item in the list in which it is being used. 

This is the value of cash and liquid assets held by the reporting party as at the relevant date, other than those classified as any of the following:
- Currency notes and coins;
- Deposits at call, being deposits redeemable or withdrawable by the reporting party on demand or within 24 hours;
- Gold bullion excluding loans repayable in gold bullion;
- Due from clearing houses, being amounts receivable from clearing houses for unsettled exchanges of securities and derivatives;
- Securities purchased under agreements to resell; and
- Securities sold but not delivered/security settlements.

