This is the value, as at the relevant date, of "Total Other Investments" as per item 6.6 on form ARF_321_0.

This amount is calculated as the sum of the following items:
- Investments in Parent Entity;
- Investments in Control Entities;
- Investments in Associates; 
- Interests in Joint Ventures; and
- Other Investments not allocated elsewhere on ARF_321_0 (balancing item).

This is the value, as at the relevant date, of "Total Other Investments" as per item 8.6 on form ARF_322_0.

This amount is calculated as the sum of the following items:
- Investment in Parent Entity;
- Investments in Associates; 
- Interests in Joint Ventures;
- Equity Investments in Former SSP's; and
- Other Investments not allocated elsewhere on ARF_322_0 (balancing item).

